import React from 'react'
import {add, sub, mult, divi} from './Calc2'

const Calc1 = () => {
  return (
<ul>
    <li>Add of two number are {add(2+2)}</li>
    <li>Sub of two number are {sub(2-5)}</li>
    <li>Mutliply of two number are {mult(3*3)}</li>
    <li>Divide of two number are {divi(9/3)}</li>
</ul>
    )
}

export default Calc1
